import VueRouter from "vue-router"
import login from '../views/Login.vue'
import index from '../views/Index.vue'
import userpage from '../views/UserPage.vue'

const routes = [
  {
    path: '/',
    name: 'login',
    component: login
  },
  {
    path: '/index',
    name: 'index',
    component: index
  },
  {
    path: '/userpage',
    name: 'userpage',
    component: userpage
  },
]

const router = new VueRouter({
  mode:'history',
  routes
})

export default router
